import React, { Component } from "react";

class Header extends Component {

  constructor(props) {
    super(props);

    this.state = {
      email: "",
      password: ""
    };
  }

  render() {
    return (
      <header><img src="../" />whatQ</header>
    )
  };
}


export default Header;
